import React from 'react';
import logoImage from '../';

const Header = () => {
  return (
    <header className="header">
      <h1>Employee Management System</h1>
        <div className="logo">
                      <img src={logoImage} alt="logo-EMS" />
        </div>
    </header>
  );
};

export default Header;
